import React, { useState } from 'react'
import { MenuItems } from './MenuItems'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faTimes, faBars, faHome, faPhoneAlt, faUser } from '@fortawesome/free-solid-svg-icons'
import './Navbar.css'


function Navbar() {
    const MenuItems = [
        {
            title: 'Home',
            url: '/',
            cName: 'nav-links',
            icon: <FontAwesomeIcon icon={faHome} />
        },
        {
            title: 'Contact',
            url: '#',
            cName: 'nav-links',
            icon: <FontAwesomeIcon icon={faPhoneAlt} />
        },
        {
            title: 'Login',
            url: '/login',
            cName: 'nav-links',
            icon: <FontAwesomeIcon icon={faUser} />
        }
    ]
    const [isClicked, toggleClick] = useState(false);

    return (
        <div>
            <nav className="navbar-items">
                <h1>VIBO.com</h1>
                <div className="menu-icon" 
                    onClick={
                        () => isClicked ? toggleClick(false) : toggleClick(true)
                    }>
                    <FontAwesomeIcon icon={isClicked ? faTimes : faBars } />
                </div>
                <ul className={isClicked ? 'nav-menu__active': 'nav-menu'}>
                    {MenuItems.map((item, index) => {
                        return(
                        <li key={index}>
                            <a className={item.cName} href={item.url}>
                                {item.icon}{" "}{item.title}
                            </a>
                        </li>
                        )
                    })}
                </ul>
            </nav>
        </div>
    );
}

export default Navbar;
